description:
Hello there everyone.
Thanks for checking this video.

I didnt expect to see a whole new pack of dinosaurs release today. Let alone the 3 awesome ones in this pack.
All dinosaurs in this pack are now disproven as species or superceded by exisiting species. However the lore covers this nicely by explaining it as Ingen breakthroughs. I like it a lot.

